import React from "react";
import "./ExpenseDate.css";

const ExpenseDate = () => {
  return (
    <div className="expense-date">
      <h2 className="expense-date__month">Mesec</h2>
      <p className="expense-date__year">Godina</p>
      <h1 className="expense-date__day">Dan</h1>
    </div>
  );
};

export default ExpenseDate;
